import React  from 'react'
import styled from 'styled-components'
import CountDown from '../../Components/CountDown';

const Container=styled.div`
width           : 100%;
height          : 80vh;
background-color: whitesmoke;
margin-top      : 50px;
`;

const StyleWrapper=styled.div`
width           : 80%;
height          : 80vh;
//background-color: yellow;
//margin-left     : auto;

position: relative;

`;
const CountDownWrapper=styled.div`

`;
const SlantDiv=styled.div`
 position: absolute;
    content: '';
    width: 100vw;
    height: 80vh;
    top: 0;
    left: 0;
    background-color: #FEDE17;
    transform: skewX(25deg);
    margin-left:-50%;
`;

const TextingDeals = () => {
    return (
       <Container>
            <div class = "conta">
                <div class = "row">
                    <div class = "col">
                        <CountDownWrapper>
                            <CountDown />
                           
                        </CountDownWrapper>
                    </div>
                    <div class = "col">
                        <StyleWrapper>
                            <SlantDiv>
                                <h1 style={{transform:'skewX(-25deg)'}}>I am also Visible</h1>
                            </SlantDiv>
                        </StyleWrapper>
                    </div>
                </div>
            </div>
        </Container>
    )
}

export default TextingDeals
